        Sub543(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   Mf(bH,gno2)*pave16(PVC(cc2),All4,All5,Cha4)*
     &     Sub537(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) + 
     &    Mf(bH,gno1)*pave16(PVC(cc1),All4,All5,Cha4)*
     &     Sub542(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4)

	ENDLOOP(All4)
	ENDLOOP(All5)
	ENDLOOP(Cha4)
	ENDLOOP(Ind1)
	ENDLOOP(Ind2)
	ENDLOOP(Ind3)
	ENDLOOP(Ind4)

	end
